from typing import List

class Solution:
    def findWordsContaining(self, words: List[str], x: str) -> List[int]:
        """Return indices of words that contain the character x."""
        result: List[int] = []
        for i, word in enumerate(words):
            if x in word:
                result.append(i)
        return result
